import React,{useEffect} from "react";
import PropTypes from "prop-types";
import {Router,Link } from "react-router-dom";
import styles from "./styles.module.scss";

import {
  ComposedChart, LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend,
} from 'recharts';
import Navigation from "../Navigation";
import ReactLoading from 'react-loading';

const MultiSearch = (props, context) => (
  <div>
  <Navigation/>
  <div className={styles.summoner}>
      <div className={styles.box}>
        
        <div className={styles.top}>
        
          <div className={styles.multibox}>
            <textarea className={styles.multitext} placeholder="T1 Canna님이 로비에 참가했습니다.
T1 Oner님이 로비에 참가했습니다.
T1 Faker님이 로비에 참가했습니다.
T1 Teddy님이 로비에 참가했습니다.
T1 Keria님이 로비에 참가했습니다." onChange={props.onKeyPress} >

            </textarea>
            <button type="submit" className={styles.multibutton} onClick={props.onClick}>
              여러 명으로 검색 (최대 5명)
            </button>
          </div>

          <div className={styles.resultBoxs}>
          {props.loading2 &&(
            <div className={styles.loading}>
                <div className={styles.title}>
                  MMR을 계산중입니다.
                </div>  
              <ReactLoading type={"cylon"} height={'50px'} width={'150px'} className={styles.loading2}/>
            </div>
          )}
          {props.loading &&(
            <div className={styles.Box}>
              {props.mmr.map((mmr) => 
              <div className={styles.resultBox}>
              <img
                  src={require("../../images/challenger_1.png").default}
                  alt={"Logo"}
                  className={styles.logo}
                />
              <div className={styles.name}>
                {mmr.summoner_name}
              </div>  
              {mmr.mmrtotiershort==="-1" &&(
                <div>
                <div className={styles.mmr}>
                  MMR : {mmr.mmr}
                </div>
                <div className={styles.mmrtotier}>
                  MMR TO TIER: Gold 4 70LP
                </div>  
                </div>
                )}
                {mmr.mmrtotiershort!=="-1" &&(
                <div>
                <div className={styles.mmrtotier}>
                  MMR 계산 불가
                </div>

                </div>
                )}
              </div>
              
              )}
            </div>
            
          )}
              

          </div>
          
          </div>
       
      </div>
  </div>
  </div>
);

MultiSearch.propTypes = {
  loading: PropTypes.bool.isRequired,
  loading2: PropTypes.bool.isRequired,
  data : PropTypes.array.isRequired,
  summonername : PropTypes.string.isRequired,
  mmr : PropTypes.array.isRequired,
  mmrdate : PropTypes.array.isRequired,
  onKeyPress:PropTypes.func.isRequired,
  onClick:PropTypes.func.isRequired
};

export default MultiSearch;
